	private Song getSongForRecord(float[][] record, int startIndex, int stopIndex) {
		SimpleDanceRecord sdr = new SimpleDanceRecord();
		sdr.setQueue(Arrays.copyOfRange(record[0], startIndex, stopIndex), 
				Arrays.copyOfRange(record[1], startIndex, stopIndex),
				Arrays.copyOfRange(record[1], startIndex, stopIndex));
		Song song = sdr.isSong();
		System.out.println("\nstats:" + sdr.getStats() + "\n");
		return song;
	}
	
